URL = 'http://192.168.1.102:5000/send-image/data:image/jpeg;base64,'

r = requests.get(URL+'',timeout=5)

print("Status: ",r.status_code)
print("Content: ",r.text)

splitter = r.text.split("|")

for a in splitter:
    if a == "":
        pass
    else:
        dict_object = json.loads(a)
        print("X-Koordinate: ",dict_object["x"])
        print("Erkanntes Objekt: ", dict_object["text"])




